  margin-bottom: 1px;
}

.o-nav-v li ul {
  margin: .5rem .5rem 1rem;
}

.o-nav-v li li {
  font-weight: lighter;
}

.o-nav-v li li ul {
  display: none;
}

.o-nav-v .router-link-active + ul,
.o-nav-v a:focus + ul {
  display: block;
}

.c-card {
  position: relative;
  max-width: 100%;
  border-radius: 2px;
}

@media only screen and (max-width: 991px) {
  .c-card + .c-card {
    margin-top: 2rem;
  }
}

.c-card__wrap {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-orient: vertical;
  -webkit-box-direction: normal;
      -ms-flex-direction: column;
          flex-direction: column;
  height: 100%;
  -webkit-transition: -webkit-box-shadow .2s;
  transition: -webkit-box-shadow .2s;
  -o-transition: box-shadow .2s;
  transition: box-shadow .2s;
  transition: box-shadow .2s, -webkit-box-shadow .2s;
  -webkit-box-shadow: 4px 4px 0 0px #333;
          box-shadow: 4px 4px 0 0px #333;
  background-color: #fff;
  border: 1px solid #333;
}

.c-card__wrap:hover {
  -webkit-box-shadow: 8px 8px 0 0px #333;
          box-shadow: 8px 8px 0 0px #333;
}

.c-card__wrap > * + * {
  border-top: 1px solid #333;
}

.c-card img {
  max-width: 100%;
}

.c-card section {
  padding: 1rem;
  -webkit-box-flex: 1;
      -ms-flex-positive: 1;
          flex-grow: 1;
}

.c-card section > *:last-child {
  margin-bottom: 0;
  padding-bottom: 0;
}

.c-card footer {
  padding: 1rem;
  text-transform: uppercase;
  font-size: .8rem;
}

.c-card footer > *:last-child {
  margin-bottom: 0;
}

article img {
  max-width: 100%;
  width: auto;
  height: auto;
}

article section a,
article footer a {
  background-color: #dadada;
  margin: -0.1em;
  padding: 0.1em;
  border: 0.1em solid transparent;
  background-clip: padding-box;
  -webkit-transition: background-color 0.2s;
  -o-transition: background-color 0.2s;
  transition: background-color 0.2s;
}

article section a:hover,
article section a:focus,
article footer a:hover,
article footer a:focus {
  text-decoration: none;
  background-color: #fff;
}

