.c-card {
  position: relative;
  max-width: 100%;
  border-radius: 2px;
}

@media only screen and (max-width: 991px) {
  .c-card + .c-card {
    margin-top: 2rem;
  }
}

.c-card__wrap {
  display: flex;
  flex-direction: column;
  height: 100%;
  transition: box-shadow .2s;
  box-shadow: 4px 4px 0 0px #333;
  background-color: #fff;
  border: 1px solid #333;
}

.c-card__wrap:hover {
  box-shadow: 8px 8px 0 0px #333;
}

.c-card__wrap > * + * {
  border-top: 1px solid #333;
}

.c-card img {
  max-width: 100%;
}

.c-card section {
  padding: 1rem;
  flex-grow: 1;
}

.c-card section > *:last-child {
  margin-bottom: 0;
  padding-bottom: 0;
}

.c-card footer {
  padding: 1rem;
  text-transform: uppercase;
  font-size: .8rem;
}

.c-card footer > *:last-child {
  margin-bottom: 0;
}

article img {
  max-width: 100%;
  width: auto;
  height: auto;
}

article section a,
article footer a {
  background-color: #dadada;
  margin: -0.1em;
  padding: 0.1em;
  border: 0.1em solid transparent;
  background-clip: padding-box;
  transition: background-color 0.2s;
}

article section a:hover,
article section a:focus,
article footer a:hover,
article footer a:focus {
  text-decoration: none;
  background-color: #fff;
}

